        public static void Initialize(ApplicationDbContext context)
        {
            context.Database.EnsureCreated();

            #region Event states 

            if (!context.EventStates.Any())
            {
                var eventStates= new EventState[]
                {
                    new EventState { Id = 1, CodeName = "Announcement", Name = "Анонс"},
                    new EventState { Id = 2, CodeName = "Event", Name = "Мероприятие"},
                };

                foreach (var s in eventStates)
                {
                    context.EventStates.Add(s);
                }
                context.SaveChanges();
            }

            #endregion

            #region  Event statuses

            if (!context.EventStatuses.Any())
            {
                var eventStatuses = new EventStatus[]
                {
                    new EventStatus { Id = 1, CodeName = "Approved", StatusName = "Потверждаю"},
                    new EventStatus { Id = 2, CodeName = "Rejected", StatusName = "Отказываюсь"},
                };  

                foreach (var s in eventStatuses)
                {
                    context.EventStatuses.Add(s);
                }
                context.SaveChanges();
            }

            #endregion

            #region Roles 

            if (!context.Roles.Any())
            {
                var roles = new IdentityRole[]
                {
                    new IdentityRole { Name = "ADMIN", NormalizedName = "ADMIN" },
                    new IdentityRole { Name = "OPERATOR", NormalizedName = "OPERATOR"},
                    new IdentityRole { Name = "OOBO", NormalizedName = "OOBO"},
                    new IdentityRole { Name = "CO", NormalizedName = "CO" },
                    new IdentityRole { Name = "ASSESSOR", NormalizedName = "ASSESSOR" },
                    new IdentityRole { Name = "STUDENT", NormalizedName = "STUDENT"}
                };

                foreach (var s in roles)
                {
                    context.Roles.Add(s);
                }
                context.SaveChanges();
            }

            #endregion 

            #region Prdso statuses 

